// import React from "react";
export default function Practice() {
  return (
   <div style={{ display: 'flex' }}>
    <button style={{ background: 'grey' }}>-</button>
    <div style={{ background: 'white' }}>
      <h1 style={{ color: 'black' }}>0</h1>
    </div>
    <button style={{ background: 'grey' }}>+</button>
   </div>
  );
};
